	label: string;
	query: any;
}

const Container = styled.div`
	position: relative;
	width: 100%;
	height: 100%;
	padding: 2rem 35px 0 70px;
	background: ${props => props.theme.primaryColor};
`;

const Home = ({query, label}:Props) => {
	console.log('Page Query 4 index ----------------------->', query);
